import { NavLink } from "react-router-dom";

export default function Header() {
  return (
    <>
      <header className="flex bg-emerald-700 w-full flex-row flex-wrap justify-around items-center max-h-80 h-full">
          <h1 className=" float-start text-7xl text-cyan-400 font-bold">FunRoulete</h1>
          <ul className="list-none flex flex-row gap-8 text-2xl font-normal text-cyan-400">
            <li className="hover:underline hover:transition-all hover:opacity-80"><NavLink to={'/'}>Voice chat</NavLink></li>
            <li className="hover:underline hover:transition-all hover:opacity-80"><NavLink to={'/chat'}>Chat</NavLink></li>
            <li className="hover:underline hover:transition-all hover:opacity-80"><NavLink to={'/blog'}>Blog</NavLink></li>
          </ul>
      </header>
    </>
  )
}
